class Out extends Component{
    render(){
        return(
            <Router >
                <Switch>
                    {/* <Route path="/"  component={Home} /> */}
                    {/* <Route path="/contact" exact component={Contact} /> */}
                    {/* <Route path="/shirt" exact component={Shirt} />     */}
                </Switch>
                {/* <Shirt></Shirt> */}
